{
  "name": "Measure response time under 1000 concurrent requests",
  "request": {
    "method": "GET",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities"]
    }
  },
  "tests": {
    "responseTime": "pm.test(\"Response time is less than 2000ms\", function () { pm.expect(pm.response.responseTime).to.be.below(2000); });"
  }
}

{
  "name": "Retrieve all activities",
  "request": {
    "method": "GET",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities"]
    }
  },
  "tests": {
    "responseCode": "pm.test(\"Status code is 200\", function () { pm.response.to.have.status(200); });"
  }
}

{
  "name": "Create activity with valid data",
  "request": {
    "method": "POST",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities"]
    },
    "body": {
      "mode": "raw",
      "raw": "{\"id\": 1, \"title\": \"Activity 1\"}"
    }
  },
  "tests": {
    "responseCode": "pm.test(\"Status code is 201\", function () { pm.response.to.have.status(201); });"
  }
}

{
  "name": "Measure response time under 1000 concurrent requests",
  "request": {
    "method": "GET",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities"]
    }
  },
  "tests": {
    "responseTime": "pm.test(\"Response time is less than 2000ms\", function () { pm.expect(pm.response.responseTime).to.be.below(2000); });"
  }
}

{
  "name": "Attempt to create activity with missing fields",
  "request": {
    "method": "POST",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities"]
    },
    "body": {
      "mode": "raw",
      "raw": "{\"title\": \"\"}"
    }
  },
  "tests": {
    "responseCode": "pm.test(\"Status code is 400\", function () { pm.response.to.have.status(400); });"
  }
}

{
  "name": "Retrieve activity by valid ID",
  "request": {
    "method": "GET",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Activities/{{id}}",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Activities", "{{id}}"]
    }
  },
  "tests": {
    "responseCode": "pm.test(\"Status code is 200\", function () { pm.response.to.have.status(200); });"
  }
}

