{
  "name": "Retrieve author by valid ID",
  "request": {
    "method": "GET",
    "url": {
      "raw": "{{baseUrl}}/api/v1/Authors/{{id}}",
      "host": ["{{baseUrl}}"],
      "path": ["api", "v1", "Authors", "{{id}}"]
    }
  },
  "tests": {
    "responseCode": "pm.test(\"Status code is 200\", function () { pm.response.to.have.status(200); });"
  }
}

